const AddUser = () =>{
     const AddUserHandler = (event) =>{
       event.preventDefault();
     }
 
    return(
        <form onSubmit={AddUserHandler}>
            <label htmlFor="username" type="text">Username</label>
            <input id="username"/>
            <label htmlFor="username" type="text">Username</label>
            <input id="username"/>
            <button type="submit">Add User</button>

        </form>
 )
};
export default AddUser ;
